import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import RouteTest from './components/RouteTest';

import Home from './Home'

function App() {
  return (
    <BrowserRouter>
    <div className="App">      
      <Routes>
        <Route path="/" element={<Home />} />        
      </Routes> 
      <RouteTest />
    </div>
    </BrowserRouter>
  );
}

export default App;
